import React, { Component } from 'react';

class CrmSetting extends Component{

  render(){
    return (
      <div className="animated fadeIn">
        <div className="ubuntu-app " style={{border:0, marginTop:20}}>
            <main>
                Setting
            </main>
        </div>
      </div>
    )
  }
}

export default CrmSetting;
